import './App.css';
import { Navbar } from './components/Navbar';
import { IntroLand } from './components/IntroLand';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Navbar/>
        <IntroLand/>
      </header>
    </div>
  );
}

export default App;
